"use strict";(self.webpackChunkstatic_site=self.webpackChunkstatic_site||[]).push([[442],{442:e=>{e.exports=JSON.parse('[{"id":"0066902c-dfbc-4094-82d7-817c1e4533e0","slug":"san-mateo-county-pride-center","externalUrl":"https://sanmateopride.org/","tags":["transmasculine","non-binary","transfeminine","healthcare","mental-health","social-services"],"address":"1021 S El Camino Real, San Mateo, CA 94402, USA","phoneNumber":"650-591-0133","country":"US","provinceOrState":"CA","city":"San Mateo","county":"San Mateo County","latLng":[37.5569591,-122.3189073],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/san-mateo-county-pride-center-san-mateo","googleMapsUrl":"https://goo.gl/maps/uj5ogP9y4LboxZYD9","facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"サンマテオ郡プライドセンター","description":"サンマテオ郡プライドセンターは、LGBTQ+コミュニティのためのコラボレーションモデル組織およびワンストップショップです。 私たちは、教育、トレーニング、コミュニティイベント、ピアサポートグループ、日常のプログラミング、臨床療法、ケース管理など、すべての年齢のLGBTQ+コミュニティメンバーをサポートするための充実したプログラムとサービスを提供しています。"},{"id":"07e16941-b605-4cf5-bab5-bdc882c51a1d","slug":"queerspace","externalUrl":"https://www.queerspace.org.au/","tags":["mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness"],"address":"100 Drummond St, Carlton VIC 3053, Australia","phoneNumber":"03 9663 6733","country":"AU","provinceOrState":"VIC","city":"Carlton","county":"City of Melbourne","latLng":[-37.8043894,144.9681606],"email":"enquiries@ds.org.au","socialMedia":{"yelpUrl":null,"googleMapsUrl":null},"title":"Queerspace","description":"Queerspaceは、2009年にLGBTIQ+コミュニティによってLGBTIQ+コミュニティのために設立された健康と幸福のサポートサービスです。関係、家族、子育て、若者に焦点を当て、ビクトリア州北西部地域全域で共同利用サービスを提供しています。サービスには、カウンセリング、ケースマネジメント、アドボカシー、サポートサービス、ピアサポート、プロフェッショナル開発、トレーニング、コンサルティングが含まれます。"},{"id":"0db36ba9-b329-4a54-8302-d7810866457a","slug":"diyhrtcafe","externalUrl":"https://diyhrt.cafe","tags":["transfeminine","non-binary","transmasculine","healthcare","education-awareness"],"title":"DIYHRT.cafe","description":"DIYHRT.cafeは、自分で行うホルモン補充療法（HRT）に興味のある人々のための活発なオンラインコミュニティと知識のハブです。彼らのウェブサイトは、自己投与のHRTに対する情報、リソース、そしてサポートにアクセスできる安全で包括的な空間を提供することに専念しています。あなたが代替方法を探しているのか、用量と投与に関するガイダンスを求めているのか、または同様の経験を共有する他の人々と繋がることを望んでいるだけなのか、DIYHRT.cafeはあなたの健康と幸福に関する情報通りの決定を下すのを支援する貴重な洞察、個人の物語、専門的なアドバイスを提供します。"},{"id":"11cfde25-5434-4fae-b782-c9597ebe52f3","slug":"deifydeify-qtibipoc-collective","externalUrl":"https://linktr.ee/deifycbr","tags":["social-services","support-groups","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"QTIBIPOC Canberra Facebook Group"},"title":"DEiFYDEiFYQTIBIPOC コレクティブは Ngunnawal、Ngunawal、Ngambri Countryに住んでいます","description":"これはDEiFYQTIBIPOCコミュニティの集会です。グループはまた、Queer Masculinities Zineと彼らの特定のプレイリストについて話し合います。"},{"id":"1873eb7a-2dcb-4346-bf6b-91a97237072f","slug":"nsw-service-for-the-treatment-and-rehabilitation-of-torture-and-trauma-survivors","externalUrl":"https://www.startts.org.au/","tags":["healthcare","mental-health","social-services"],"phoneNumber":"+61 (0)2 9646 6700","country":"AU","provinceOrState":"NSW","city":"Carramar","address":"152/168 The Horsley Dr, Carramar NSW 2163, Australia","latLng":[-33.8801011,150.9654668],"email":"stts-startts@health.nsw.gov.au","socialMedia":{"twitterUrl":"https://twitter.com/starttsNSW","facebookUrl":"https://www.facebook.com/STARTTSNSW","instagramUrl":"https://www.instagram.com/startts_nsw/","linkedinUrl":"https://www.linkedin.com/company/startts/","youtubeUrl":"https://www.youtube.com/user/starttsvideos"},"county":"City of Fairfield","title":"拷問およびトラウマの生存者のためのNSW治療およびリハビリテーションサービス","description":"STARTTSは、専門的な非営利団体であり、文化的に関連性を持つ心理療法、支援、そしてコミュニティ介入を提供して、人々とコミュニティが拷問および難民のトラウマから治癒し、その生活をオーストラリアで再建するためのサポートをしています。また、彼らは難民や亡命申請者の背景を持つLGBTQIA+の個々の人々もサポートしています。"},{"id":"18ba5d3d-c47d-47f8-90a4-2f353a1f13ce","slug":"ftmguideorg","externalUrl":"https://FTMGuide.org","tags":["non-binary","transmasculine","healthcare","clothing"],"title":"FTMGuide.org","description":"女性から男性（FTM）への性別遷移をする個人を支援するための包括的なオンラインプラットフォームです。そのウェブサイトは信頼できるリソースとして提供され、FTMの旅に乗り出す人々に情報、ガイダンス、そしてコミュニティの接続を提供します。ホルモン療法や手術の選択肢に関する実用的なアドバイスから、メンタルヘルスのサポート、個人的なストーリーまで、FTMGuide.orgは、個人が自身の性別遷移を自信と明確さで進めるための知識とリソースを提供することを目指しています。"},{"id":"1e8cb769-f49b-4428-86ea-2c4cbec96905","slug":"transfemscienceorg","externalUrl":"https://transfemscience.org","tags":["transfeminine","non-binary","healthcare"],"title":"transfemscience.org","description":"この革新的なオンラインプラットフォームは、トランスジェンダーやノンバイナリーコミュニティに、特に女性化ホルモン療法（FHT）に焦点を当てたエビデンスに基づく研究、教育、リソースを提供することを目指しています。彼らのウェブサイトは、FHTの医学的、生理学的、心理学的側面について信頼性のある最新の情報を求める個人にとって重要なハブとなっています。ピアレビューされた研究、専門家の記事、実用的なガイドの包括的なコレクションを通じて、彼らのサイトは個人が自身の遷移と健康についての情報に基づいた決定を下すことを力強く後押しします。"},{"id":"3143b616-c478-4c99-9cbd-ed16c89a1c70","slug":"meridian-support","externalUrl":"https://www.meridianact.org.au/","tags":["healthcare","support-groups","education-awareness","community-stories"],"address":"Havelock House, 85 Northbourne Ave, Turner ACT 2612, Australia","phoneNumber":"(02) 6257 2855","country":"AU","provinceOrState":"ACT","city":"Turner","latLng":[-35.2736943,149.1291121],"email":"contact@meridianact.org.au","socialMedia":null,"title":"メリディアン","description":"メリディアンは40年以上にわたり、LGBTIQA+コミュニティを推進し、支援してきました。キャンベラ地域全体でHIVサービス、ウェルビーングサービス、セックスワーカーアウトリーチプログラムなど、さまざまなサービスとプログラムを提供しています。"},{"id":"3b112584-39e6-4ef6-9e75-a465acdea54c","slug":"northern-territory-aids-and-hepatitis-council-inc","externalUrl":"https://www.ntahc.org.au/","tags":["healthcare","social-services","education-awareness"],"address":"46 Woods St, Darwin City NT 0800, Australia","phoneNumber":"08 8944 7777","country":"AU","provinceOrState":"NT","city":"Darwin City","county":"City of Darwin","latLng":[-12.4602736,130.8432107],"email":"info@ntahc.org.au","socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://www.google.com/maps?q=46+Woods+StreetDARWIN+NT+0800"},"title":"ノーザンテリトリーAIDSおよび肝炎対策協議会","description":"ノーザンテリトリーでの血液感染病に対するコミュニティの対応であり、その伝播を撲滅することを目指しています。LGBTI Livingの支援、セックスワーカーのアウトリーチの推進、健康促進と健康クリニックの提供など、さまざまなサービスを提供しています。"},{"id":"3b5a33bd-aba4-4205-9a86-293b172e38ee","slug":"genderdysphoriafyi","externalUrl":"https://genderdysphoria.fyi","tags":["transmasculine","non-binary","transfeminine","mental-health","support-groups","community-stories","education-awareness"],"title":"genderdysphoria.fyi","description":"ジェンダー違和症について知識を求め、サポートを必要としている個々のための信頼できるオンラインリソースです。彼らのウェブサイトは情報、リソース、コミュニティとのつながりを提供し、個々の旅を強化します。ジェンダーアイデンティティとトランジションに関する包括的なガイドから個人の話や専門家のアドバイスまで、すべての人に対する安全で包括的なスペースを作り出すことを目指しています。"},{"id":"3f865b77-21e6-472e-be98-b2cfd999dafb","slug":"unitarian-universalist-association","externalUrl":"https://www.uua.org/","tags":["non-binary","support-groups","education-awareness","spiritual"],"address":"24 Farnsworth St, Boston, MA 02210, USA","phoneNumber":"(617) 742-2100","country":"US","provinceOrState":"MA","city":"Boston","county":"Suffolk County","latLng":[42.35163259999999,-71.04857050000001],"email":"info@uua.org","socialMedia":null,"title":"ユニタリアンユニバーサリスト協会","description":"公正、愛、学習、希望に満ちた生活を送る人々を支援する、心と心が開かれた精神的コミュニティです。このコミュニティは多様性を包括し、トランスジェンダーコミュニティを含め、公正な行為に積極的に参加することを奨励しています。さらに、さまざまな社会問題に対するリソース、支援、提唱も提供しています。"},{"id":"4332f79d-1323-45ca-9b40-df63af9b7179","slug":"movement-advancement-project","externalUrl":"https://www.lgbtmap.org/","tags":["legal","healthcare","education-awareness"],"address":"1905 15th St #1097, Boulder, CO 80302, USA","email":null,"phoneNumber":"(303) 578-4600","country":"US","provinceOrState":"CO","city":"Boulder","county":"Boulder County","latLng":[40.0178641,-105.2763041],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/lgbtmap/","twitterUrl":"https://twitter.com/lgbtmap","instagramUrl":"https://www.instagram.com/lgbtmap/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"ムーブメントアドバンスメントプロジェクト","description":"ムーブメントアドバンスメントプロジェクト（MAP）は、独立した非営利のシンクタンクであり、すべての人に平等と機会を迅速に提供するための厳密な研究、洞察、コミュニケーションを提供します。MAPは、すべての人が健康と幸福を追求し、生計を立て、愛する人を世話し、地域社会で安全を確保し、市民生活に参加するための公平なチャンスを持つことを確保するために活動しています。"},{"id":"43609b17-7528-4c60-94b4-e90866144715","slug":"jordan-ross-communication-services","externalUrl":"https://www.jordanrosscommunication.com/","tags":["voice-training"],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":"https://www.instagram.com/jordanrosscommunication/","youtubeUrl":"https://www.youtube.com/channel/UC4o7h219hPYdBcPaFpgh9Yw","tiktokUrl":"https://www.tiktok.com/@jordanrosscommunication","twitchUrl":null,"patreonUrl":null},"title":"ジョーダン・ロス　コミュニケーションサービス","description":"ジョーダン・ロスは、トランスジェンダー、クィア、ジェンダー非一貫性の個人向けにスピーチ、声、コミュニケーションのコーチングを提供しています。彼は1対1のコーチング、オンラインコース、イベント、そして「ボイス・ウィズイン・コーチング・プログラム」を提供しています。彼のアプローチは、ニューロリンギスティックプログラミング、催眠療法、ヨガの指導、呼吸コーチングを取り入れ、コミュニケーションの物理的な側面だけでなく、精神的、感情的、エネルギー的な側面にも対応することを目指しています。"},{"id":"4465cbb7-3513-41ae-8878-7a86ebbe9f6a","slug":"gender-dynamix-online-education-portal","externalUrl":"https://www.genderdynamix.org.za/","tags":["transfeminine","transmasculine","non-binary","legal","healthcare","education-awareness","support-groups","community-stories"],"address":"7, 10 Anson St, Observatory, Cape Town, 7925, South Africa","phoneNumber":"+27 (0)21 447 4797","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9368811,18.470378],"email":"info@genderdynamix.org.za","socialMedia":null,"town":"Observatory","title":"ジェンダーダイナミクスオンライン教育ポータル","description":"ジェンダーダイナミックスは、アフリカを拠点にした非営利団体で、南アフリカおよび南部アフリカ全体のトランスジェンダーおよびジェンダーダイバーシティコミュニティの人権を促進、発展、保護を目指しています。この団体は、アドボカシー活動を行い、能力構築を促進し、コミュニティに直接的なサービスを提供します。また、医療、教育プログラム、法的な性別の認識に関連するオンラインリソースも提供しています。"},{"id":"47b17f76-670a-4835-8773-409d98934b91","slug":"sylvia-rivera-law-project","externalUrl":"https://srlp.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"address":"147 W 24th St #5th, New York, NY 10011, USA","phoneNumber":"212-337-8550","country":"US","provinceOrState":"NY","city":"New York","town":"Manhattan","county":"New York County","latLng":[40.744576,-73.9941166],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/sylvia-rivera-law-project-new-york?osq=sylvia+rivera+law+project","googleMapsUrl":"https://goo.gl/maps/sjGv8qoSZPe3XE2QA","facebookUrl":"https://www.facebook.com/sylviariveralawproject","twitterUrl":"https://www.twitter.com/srlp","instagramUrl":"https://instagram.com/sylviariveralawproject/","youtubeUrl":"https://www.youtube.com/user/SylviaRiveraLP","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"シルビア・リベラ法律プロジェクト（SRLP）","description":"シルビア・リベラ法律プロジェクトは、すべての人々が所得や人種にかかわらず、ハラスメント、差別、暴力に直面することなくジェンダーアイデンティティと表現を自己決定できるように保証するために活動しています。 SRLPは法律支援を提供し、キャンペーンを組織し、研修を行い、囚人諮問委員会を運営しています。寄付、ボランティア活動、会員登録を通じてコミュニティの参加が奨励されています。"},{"id":"499aa5dd-d3c0-42f6-a686-853672f3c71e","slug":"erin-in-the-morning","externalUrl":"https://www.erininthemorning.com/","tags":["transfeminine","legal","healthcare","education-awareness"],"email":"null","socialMedia":{"facebook":"facebook.com/erininthemorning","email":"mailto:info@erininthemorning.com"},"title":"エリンのモーニング","description":"トランスに関する法律と生活についてのニュースと議論。エリン・リードによる · 38,000人以上の購読者"},{"id":"4a930816-9948-45d7-9513-393087685a01","slug":"trans-health-sa","externalUrl":"https://www.transhealthsa.com/","tags":["healthcare","legal","social-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"SA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/TransHealthSA","googleMapsUrl":null,"yelpUrl":null},"title":"Trans Health SA","description":"Trans Health SAは、南オーストラリアのトランスジェンダーやジェンダーダイバーシティに対する健康上のニーズに情報と支援を提供することを目的としたボランティアグループです。それは、敬意を持って対応する医療専門家のリスト、医療および法律の情報、支援を行う機関や組織、出版物、社会的または支援グループ、そしてトランスジェンダーコミュニティによって作られたリソースについての情報を提供します。"},{"id":"4be75e80-8ce1-4f46-90f0-ad307cd1829b","slug":"equaldexcom","externalUrl":"https://EqualDex.com","tags":["transfeminine","non-binary","transmasculine","partner-resources"],"title":"EqualDex.com","description":"包括的で最新の世界のLGBTQ+の権利に関するリソースを作成することを目指して開発された革新的なオンラインプラットフォームです。そのウェブサイトは、世界中のLGBTQ+の権利に対する法律、政策、社会的態度の集中データベースを提供しています。平等、包含性、法的保護についてのデータをマッピングし、視覚化することで、EqualDex.comは、活動家、研究者、そして世界規模でLGBTQ+の権利を理解し、主張しようとする個人にとって強力なツールを提供します。彼らのインタラクティブな地図を探索し、国別のプロファイルを参照し、世界中のLGBTQ+コミュニティが直面する最新の進歩と課題について情報を得てください。"},{"id":"581b9bb9-0e33-4887-8bf0-0dda3781202c","slug":"a-gender-agenda","externalUrl":"https://genderrights.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","community-stories","education-awareness","financial-aid-scholarships"],"address":null,"phoneNumber":"(02) 6162 1924","country":"AU","provinceOrState":null,"city":"Canberra","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"ジェンダーアジェンダ","description":"ジェンダーアジェンダは、インターセックス、トランス、ジェンダーダイバーシティの人々、彼らの友人、家族、そして協力者のために、そして彼らと一緒に働きます。教育、擁護、ピアサポート、プロフェッショナルネットワークを通じて、AGAは人々を互いにつなぎ、集団の経験を活用します。彼らは、サポートグループ、トレーニング、教育リソースを含むコミュニティのための多くのイベントとリソースを提供します。彼らはアドボカシーと危機ヘルプラインを提供します。"},{"id":"58738396-e4d7-424a-ba8d-59559e883f06","slug":"strandsfortransorg","externalUrl":"https://strandsfortrans.org","tags":["transfeminine","non-binary","transmasculine","friendly-businesses","makeup"],"title":"strandsfortrans.org","description":"Strands For Transは、すべてのゲスト、特にトランスコミュニティからのゲストに対して安全で肯定的な体験を作り出し、触発することを目指す、髪、美容、ウェルネス産業および組織のグローバルネットワークです。"},{"id":"594ba858-974c-4c09-8fd4-f4bb35ca6c5f","slug":"pacific-center-for-human-growth","externalUrl":"https://www.pacificcenter.org/","tags":["mental-health","support-groups","healthcare","youth-services","education-awareness"],"address":"2712 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"510-548-8283","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8611143,-122.2593404],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/pacific-center-berkeley","googleMapsUrl":"https://goo.gl/maps/dSnoipA7TWiDN72b7","facebookUrl":"https://www.facebook.com/pacific.center","twitterUrl":null,"instagramUrl":"https://www.instagram.com/pacificcenterberkeley/","youtubeUrl":"https://www.youtube.com/user/TheInQueery","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"パシフィック人間成長センター","description":"1973年設立のパシフィック人間成長センターは、湾岸エリアで最も古いLGBTQIA+センターであり、全国で3番目に古いセンターであり、アラメダ郡のLGBTQIA+とQTBIPOCの人々及びその家族向けに、唯一のスライディングスケールのメンタルヘルスクリニックを運営しています。"},{"id":"5ac3fd1a-2d29-4001-b51c-d3b62d81e090","slug":"transgender-victoria","externalUrl":"https://tgv.org.au/","tags":["transmasculine","transfeminine","non-binary","legal","healthcare","mental-health","social-services","support-groups","parent-family-resources","partner-resources","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"VIC","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/TransGenderVictoria/","twitterUrl":"https://twitter.com/transgendervic","instagramUrl":"https://www.instagram.com/transgendervic/"},"title":"トランスジェンダービクトリア","description":"TGVは、トランスとジェンダーダイバーシティな人々のためのビクトリア州の主導的な組織です。私たちは、私たちのコミュニティ、そのパートナー、家族、友人、そして同盟者のための正義、均等性、包摂を実現するために働いています。私たちは、トランスジェンダーコミュニティの社会、経済、健康、福祉、心の健康の結果を目指して、さまざまなリソース、トレーニング、擁護、および支援サービスを提供しています。"},{"id":"682fba48-f668-4fe6-89a7-05a90193e778","slug":"oakland-lgbtq-community-center","externalUrl":"https://www.oaklandlgbtqcenter.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness","financial-aid-scholarships","community-stories","partner-resources"],"address":"3207 Lakeshore Ave, Oakland, CA 94610, USA","phoneNumber":"510-882-2286","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8103802,-122.2459822],"socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://goo.gl/maps/EnhwARKBin25SAmA6","facebookUrl":"https://www.facebook.com/oaklandlgbtqcommunitycenter/?notify_field=blurb&modal=profile_completion&notif_t=page_profile_blurb&notif_id=1499829595947085","twitterUrl":null,"instagramUrl":"https://www.instagram.com/oaklandlgbtqcenter","youtubeUrl":"https://youtu.be/3qxj1a9esuU","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"オークランドLGBTQコミュニティセンター","description":"オークランド初の非営利組織501c3、全年齢、全包括的なLGBTQコミュニティサービスセンター。提供されるサービスには、サポートグループ、メンタルヘルスサポート、住宅援助、若者向けプログラム、法律相談所、食料品パントリーなどがあります。また、年配のLGBTQ+の人々やトランスジェンダーのコミュニティメンバーのための特別プログラムも行われています。"},{"id":"6f38810d-896c-4493-afe2-b612021122fc","slug":"the-shed-melbourne","externalUrl":"https://www.theshedsupport.org.au/","tags":["transmasculine","mental-health","support-groups","healthcare","social-services"],"address":"412 Lygon St, Brunswick East VIC 3057, Australia","phoneNumber":null,"country":"AU","provinceOrState":"VIC","city":"Brunswick East","county":"City of Merri-bek","latLng":[-37.76497579999999,144.9730678],"email":null,"socialMedia":null,"title":"The Shed Melbourne","description":"メルボルンを拠点としたトランスマスキュリン（性転換を望む男性）のためのサポートグループで、ピアサポートのミーティング、ジムクラブ、読書クラブ、心の健康リソース、手術やテストステロンに関する情報とサポート、バインダープログラムなど、さまざまなイベントとリソースを提供しています。"},{"id":"79fdc5af-520b-45bc-a634-7af3d030db42","slug":"shinesa","externalUrl":"https://shinesa.org.au/","tags":["healthcare","education-awareness","mental-health","social-services","support-groups"],"address":"64C Woodville Rd, Woodville SA 5011, Australia","phoneNumber":"8300 5300","country":"AU","provinceOrState":"SA","city":"Woodville","latLng":[-34.87943560000001,138.536817],"email":"info@shinesa.org.au","socialMedia":null,"county":"Charles Sturt","title":"SHINE SA","description":"南オーストラリアの健康組織で、臨床サービス、性的健康に関するカウンセリングや教育、性と生殖に関する健康や関係スキルに関連した教育と研修を提供しています。また、LGBTIQA+コミュニティーのためのサポートと包括的なサービスを提供しています。国際的なトランスジェンダーと性的多様性を持つコミュニティの権利と認知のために祝賀し、支持する活動にも参加しています。"},{"id":"7a817d4c-02db-4c00-9988-6c2dbf63a7d4","slug":"zoe-belle-gender-collective","externalUrl":"https://zbgc.org.au/","tags":["education-awareness","social-services","support-groups"],"address":"58 Mundy St, Bendigo VIC 3550, Australia","phoneNumber":"0467 569 635","country":"AU","provinceOrState":"VIC","city":"Bendigo","county":"Greater Bendigo","latLng":[-36.7605293,144.2860065],"email":"contact@zbgc.org.au","socialMedia":null,"title":"ゾーイ・ベル・ジェンダー・コレクティブ","description":"ゾーイ・ベル・ジェンダー・コレクティブは、トランスジェンダーやジェンダー多様性を尊重する活動を主導する組織で、専門的な訓練、ワークショップ、そしてLGBTQI+コミュニティの支援を提供しています。コミュニティサービス、労働者、家族や友人、トランスジェンダーやジェンダー多様性の個々人のためのリソースと支援を提供しています。また、最近では、シスジェンダーの男性によるトランスジェンダーの女性に対する暴力を防ぐためのイニシアチブ、トランスフェムを立ち上げました。"},{"id":"7fb1e1a6-bd81-4515-9aaa-70aea4580e55","slug":"gender-diversity","externalUrl":"https://genderdiversity.org","tags":["education-awareness","healthcare","youth-services","support-groups","parent-family-resources","social-services","non-binary","transmasculine","transfeminine"],"address":"6523 California Ave SW #144, Seattle, WA 98136","country":"US","provinceOrState":"WA","city":"Seattle","county":"King County","latLng":[47.544046,-122.387452],"phoneNumber":"1-833-3GENDER","email":"info@genderdiversity.org","title":"ジェンダー・ダイバーシティ","description":"ジェンダー・ダイバーシティは、教育を提供し、認識を高め、人間経験の広範な範囲を示すことで、すべてのジェンダー・アイデンティティと表現の子供と大人の幸福を改善します。また、トランスジェンダーとジェンダー多様性を持つ個人のために、学校、スポーツチーム、職場、健康保険提供者の中で支援的で差別のない環境を作るのを手伝います。"},{"id":"83a5458b-864a-4180-a176-b291ffbc7cfb","slug":"nsw-treatment-and-rehabilitation-torture-trauma-survivors","externalUrl":"https://www.startts.org.au/","tags":["healthcare","mental-health","social-services","education-awareness"],"address":"152/168 The Horsley Dr, Carramar NSW 2163, Australia","phoneNumber":"+61 (0)2 9646 6700","country":"AU","provinceOrState":"NSW","city":"Carramar","county":"City of Fairfield","latLng":[-33.8801011,150.9654668],"email":"stts-startts@health.nsw.gov.au","socialMedia":{"googleMapsUrl":null,"linkedinUrl":null,"facebookUrl":null,"youtubeUrl":null},"title":"トーチャーとトラウマの生存者たちへの治療とリハビリテーションのためのNSWサービス","description":"STARTTSは、文化に関連した心理治療、コミュニティ介入、トーチャーと難民トラウマの傷から回復するのを助けるサービスへのトレーニングを提供します。彼らの目指すところは、性的少数者や性別、体の多様性を含む難民や亡命求める人々に対する安全で支援的な環境を創造することです。"},{"id":"878e809b-12aa-483f-be01-3c51a4d331d6","slug":"national-center-for-transgender-equality","externalUrl":"https://transequality.org","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","education-awareness","financial-aid-scholarships"],"address":"1032 15th St NW #199, Washington, DC 20005, USA","phoneNumber":"(202) 642-4542","country":"US","provinceOrState":"CA","city":"Washington D.C.","county":"District of Columbia","latLng":[38.903438,-77.035037],"email":"ncte@transequality.org","socialMedia":{"blogUrl":"https://transequality.org/blog"},"title":"トランスジェンダーの平等を促進する全国センター","description":"トランスジェンダーの平等を促進する全国センターは、トランスジェンダーの人々の理解と受け入れを向上させるための政策や社会的態度の変更を提唱する組織です。NCTEは、トランスジェンダーコミュニティに影響を与える問題についての情報を提供しています。これには、高齢化、反暴力、雇用、家族、健康＆HIV、住宅とホームレス、その他が含まれます。"},{"id":"8a206480-e41f-4bb6-9128-94d4b04cd997","slug":"the-inner-circle","externalUrl":"https://theinnercircle.org.za/","tags":["education-awareness","support-groups","spiritual"],"address":"Lester Rd, Wynberg, Cape Town, 7824, South Africa","phoneNumber":"+27 (0) 21 761 0037","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-34.011883,18.469623],"email":"admin@theinnercircle.org.za","socialMedia":{"facebook":"https://www.facebook.com/pg/The-Inner-Circle-151896104833723/","twitter":"https://twitter.com/TIC_SouthAfrica"},"town":"Wynberg","title":"インナーサークル","description":"性的指向やジェンダーのアイデンティティに基づいてマーガナライズされたムスリムへの癒しを目指す、全世界のムスリムコミュニティ。スピリチュアリティ、教育、そして運動形成を通じて実現します。"},{"id":"8ab7bb47-206d-4872-a3ca-e692ce2036ec","slug":"florida-name-change-home","externalUrl":"https://www.floridanamechange.org/","tags":["legal","social-services"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":"FL","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"フロリダ姓名変更ホーム","description":"このウェブサイトは、フロリダで自分の名前や性別を更新したい方向けの段階的なガイダンスを提供します。手続きには、裁判所に嘆願書を提出し、社会保障カード、運転免許証、パスポート、出生証明書を更新することが含まれます。"},{"id":"9e09fcfd-eb5b-4dd9-825c-ae3c3c5ce940","slug":"trans-lifeline-peer-support-and-resources","externalUrl":"https://translifeline.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships"],"address":null,"email":null,"phoneNumber":"(877) 565-8860","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TransLifeline/","twitterUrl":"https://twitter.com/TransLifeline","instagramUrl":"https://www.instagram.com/translifeline/?hl=en","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Trans Lifeline","description":"Trans Lifelineは、トランスジェンダーコミュニティのための仲間のサポートとリソースを提供するトランスが主導する組織です。コミュニティーサポート、マイクログラント、ホットラインに焦点を当て、彼らはトランスの人々が繁栄するために必要なつながりとリソースを提供することを目指しています。Trans Lifelineはまた、#SafeHotlinesなどの取り組みを通じて、トランスコミュニティのために提唱します。"},{"id":"a453684e-c325-457f-8841-05c0adabbbc0","slug":"the-trevor-project","externalUrl":"https://www.thetrevorproject.org/","tags":["youth-services","support-groups","mental-health","education-awareness"],"address":"West Hollywood, CA 90069, USA","email":null,"phoneNumber":"(212) 695-8650","country":"US","provinceOrState":"CA","city":"West Hollywood","county":"Los Angeles County","latLng":[34.0931603,-118.3783347],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TheTrevorProject","twitterUrl":"https://twitter.com/trevorproject","instagramUrl":"https://www.instagram.com/trevorproject/","youtubeUrl":"https://www.youtube.com/thetrevorproject","tiktokUrl":"https://www.tiktok.com/@trevorproject","twitchUrl":null,"patreonUrl":null},"title":"The Trevor Project","description":"Trevor Projectは、LGBTQ+の若者に自殺予防サービスを提供するアメリカの非営利団体です。このサイトは、危機介入や自殺予防ホットライン、TrevorChat、TrevorText、さらには精神保健、社会サービス、支援団体に関する指導を含む、トランスジェンダーコミュニティにとって価値あるリソースを提供しています。"},{"id":"a58acbca-7d7d-4c6d-8d5f-f1a281e0f8b9","slug":"pronoun-dressing-room","externalUrl":"http://www.pronouns.failedslacker.com/","tags":["non-binary","transmasculine","transfeminine","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"代名詞の試着室","description":"代名詞の試着室は、個々の人々がどのセットの代名詞が自分に合っているかを探求し、試すためのオンラインスペースを提供します。このウェブサイトは、トランスジェンダーのコミュニティが異なる文脈での異なる代名詞がどのように見えるかを見ることにより、代名詞の選択を容易にします。"},{"id":"ab058b91-49cf-4733-b3a3-47ea59b31a78","slug":"a-place-for-marsha","externalUrl":"https://www.aplaceformarshaofficial.org/","tags":["transmasculine","non-binary","transfeminine","legal","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships","community-stories"],"email":"info@aplaceformarshaofficial.org","socialMedia":{"tiktok":"https://www.tiktok.com/@aplaceformarsha"},"title":"マーシャのための場所","description":"「マーシャのための場所」は、増加する危険な状態の中でトランスの個人と家族をより安全な場所に移すことを目指している多くのスタートアッププロジェクトの1つです。 APFMは、全国の反トランス法の増加に反応して2023年3月にその旅を始めました。 APFMは現在、赤い州からの難民とルームメイトをマッチングさせることに焦点を当てており、一つずつ世帯を丁寧に取り扱っています。"},{"id":"af3483e3-d7f7-49d7-a4e9-b70e566bee98","slug":"good-hope-metropolitan-community-church","externalUrl":"https://www.goodhopemcc.org","tags":["spiritual"],"address":"18 Belmont Rd, Rondebosch, Cape Town, 7700, South Africa","phoneNumber":null,"country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9605258,18.474311],"email":"secretary@goodhopemcc.org","socialMedia":{"facebook":"https://www.facebook.com/goodhopemcc"},"town":"Rondebosch","title":"GOOD HOPE都市共同体教会","description":"イエス・キリストの原則に基づいて設立された、神学的に進歩的で包括的なキリスト教共同体。多様性を祝い、すべての人々が歓迎される安全で非批判的な空間を提供します。南アフリカ、ケープタウンに拠点を置く包括的なキリスト教会であり、より大きな国際的な信者集団である都市共同体教会 (MCC) の一部です。"},{"id":"b6955ff7-83b4-464f-8be8-72a50dc6a878","slug":"transvoicelessons","externalUrl":"https://www.transvoicelessons.com/","tags":["voice-training"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":"https://www.youtube.com/c/transvoicelessons","tiktokUrl":null,"twitchUrl":null,"patreonUrl":"https://www.patreon.com/transvoicelessons/posts"},"title":"TransVoiceLessons","description":"TransVoiceLessonsは、より男性的、女性的、または中性的な音声を目指すトランスジェンダーや非バイナリーの個人向けに、質の高い声のコントロールと解放サービスを提供します。"},{"id":"b86b3697-6f65-4fd1-8506-e2ce879a614c","slug":"working-it-out-tasmania","externalUrl":"https://www.workingitout.org.au/","tags":["non-binary","transmasculine","transfeminine","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"TAS","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Working It Out","description":"Working It Outは、タスマニア州の性、ジェンダー、インターセックスのステータスを支援し、教育するサービスです。LGBTIQ+のタスマニア人のためのサポートとアドボカシーサービスを提供し、学校、職場、政府、非政府組織に教育とトレーニングプログラムを提供します。"},{"id":"b933717d-90e3-4aff-a61f-bd1fd1f2893b","slug":"thorne-harbour-health","externalUrl":"https://thorneharbour.org/","tags":["healthcare","support-groups","mental-health","social-services","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"ソーン・ハーバー・ヘルス","description":"LGBTIQ+ コミュニティがコントロールする健康と福祉サービスを提供する組織で、セックス、ジェンダー、セクシュアリティの多様なコミュニティを含む、HIVのサポートと予防、カウンセリング、家庭内暴力のサービスが含まれます。"},{"id":"be5fc820-136d-4e7f-a3b5-ae6d103ef1ad","slug":"gender-centre","externalUrl":"https://gendercentre.org.au/","tags":["transmasculine","transfeminine","non-binary","mental-health","social-services","support-groups","education-awareness","healthcare"],"address":null,"phoneNumber":"02 9519 7599","country":"AU","provinceOrState":null,"city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"ジェンダーセンターInc.","description":"ジェンダーセンターInc.は、ジェンダーアイデンティティの探求と、性別不一致の軽減を支援するための幅広い専門サービスを提供しています。彼らが自分自身の本当の意味を探求し、生きるたびにトランスジェンダーやジェンダー表現の人々を支援します。宿泊、ケース管理、教育＆訓練、カウンセリング＆メンタルヘルスサービス、グループ、ニュース、リソースを提供しています。"},{"id":"c23736ad-03dc-41dd-b8f9-4f64b2727cdc","slug":"freedom-centre-wa","externalUrl":"https://www.freedom.org.au/","tags":["youth-services","mental-health","social-services","support-groups","education-awareness","parent-family-resources"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"WA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/FreedomCentrePerth","instagramUrl":"https://www.instagram.com/freedom_centre/"},"title":"フリーダムセンター","description":"フリーダムセンターは、WAのLGBTIQA+の若者向けの幅広いサポートサービスを提供しています。これには、ドロップインセッション、コミュニティ開発、カウンセリングなどが含まれます。彼らはすべてのLGBTIQA+の若者が包含され、つながりを感じ、尊重されるように働いています。また、親、専門家、コミュニティ、組織にトレーニングとガイダンスを提供しています。"},{"id":"cd48f2d0-8241-4fa5-a0aa-dc3cd3d386e8","slug":"rainbowrailroadorg","externalUrl":"https://RainbowRailroad.org","tags":["transfeminine","non-binary","transmasculine","legal","social-services"],"title":"RainbowRailroad.org","description":"逼迫や暴力に直面しているLGBTQ+の個々を支援し、擁護するための重要なオンラインプラットフォーム。揺るぎないコミットメントをもって、ウェブサイトは直接的な危険から生命を救うリソース、緊急援助、そして安全な逃亡路へとつなげています。地元の団体とのパートナーシップや支持者のネットワークを通じて、RainbowRailroad.orgは避難、法的援助、リロケーションサポートを提供し、個々が迫害から逃れて避難地を見つけることができるようにしています。人権を擁護し、命を救い、より包括的な世界を育てることで、RainbowRailroad.orgは安全と自由を求めるLGBTQ+の個々にとって希望と保護の灯台として機能しています。"},{"id":"d59c0a9f-14ff-4c55-94d6-82313925be14","slug":"the-mckenzie-project","externalUrl":"https://www.themckenzieproject.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":"8390 W Flagler St STE 201, Miami, FL 33144, USA","email":"Info@TheMcKenzieProject.org","phoneNumber":"305-846-3186","country":"US","provinceOrState":"FL","city":"Miami","county":"Miami-Dade County","latLng":[25.769445,-80.3321284],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"マッケンジー・プロジェクト","description":"ジェンダー正義の推進とトランスジェンダーコミュニティの支援を目指すサービス、プログラム、イベントを提供する包括的なリソースです。ヘルスケア、法的援助、精神保健サービスなどの支援サービスとリソースが含まれています。"},{"id":"d7378cc4-7726-4de1-8427-8203cb9b61ad","slug":"east-bay-trans-queer-counseling","externalUrl":"https://www.eastbaytranscounseling.org/","tags":["transmasculine","non-binary","transfeminine","mental-health","social-services","youth-services","education-awareness"],"email":"eastbaytranscounseling@gmail.com","address":"3099 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"781-775-7802","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8538725,-122.2596505],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"イーストベイ トランス & クィア カウンセリング","description":"イーストベイ トランス & クィア カウンセリングは、以下のようなスライディングスケールのサービスを提供しています: バークレー、CAに位置する個人療法、ジェンダーの探求と移行を通じたサポート、ホルモンや手術の推薦状、精神保健提供者、学生、雇用者向けの専門トレーニング。サム・デイビスは、トランスジェンダー、ジェンダークィアのライセンスを持つ臨床社会福祉士（LCSW）で、トランスジェンダー、クィア、ジェンダークィア、ジェンダー非適合の10代と大人との勤務に特化しています。彼らは、イーストベイの精神保健プロバイダーとして16年の経験を持ち、LGBTQIカンファレンスでのコミュニティ教育、アラメダ郡での発達した人々への臨床実践と危機カウンセリング9年、ピアサポートグループの促進を含みます。彼らは、マージナル化された人々を代表しての長期間に及ぶ組織化の歴史を持つ強力で専念した支持者です。"},{"id":"dcb18ebe-596d-4d3e-a409-542f06a109a7","slug":"seahorse-victoria-club","externalUrl":"https://seahorsevic.com.au/","tags":["support-groups","community-stories","friendly-businesses"],"address":"St Kilda VIC 3182, Australia","phoneNumber":"0401 455 198","country":"AU","provinceOrState":"VIC","city":"St Kilda","county":"Port Phillip","latLng":[-37.864,144.982],"email":"seahorsevic@gmail.com","socialMedia":{"yelpUrl":null,"googleMapsUrl":null},"title":"シーホースビクトリアクラブ","description":"設立1975年、シーホースクラブビクトリアはトランスジェンダーコミュニティのためのリソース、コミュニティサービス、サポートを提供しています。それにはトランスフレンドリーなサービスディレクトリとメンバーがつながるための今後のオンラインプラットフォームが含まれています。"},{"id":"e51c019c-8dfe-498e-b82e-4263a8f747e8","slug":"equality-florida","externalUrl":"https://www.eqfl.org/","tags":["legal","healthcare","education-awareness"],"address":null,"country":"US","provinceOrState":"FL","city":"St. Petersburg","county":null,"latLng":null,"email":null,"phoneNumber":"813-870-3735","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/equalityfl/","twitterUrl":"https://twitter.com/EqualityFlorida","instagramUrl":"https://www.instagram.com/equalityfl/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"イクオリティフロリダ","description":"フロリダ州最大のLGBTQ提唱団体で、安全で健康的な学校、LGBTQの健康平等、HIVアドボカシー、LGBTQ保護などに向けて取り組んでいます。この組織は様々なイベントを開催し、プロイクオリティサポートを確保し、トランスジェンダーの医療助成金に貢献しています。"},{"id":"e5b7c0b6-7106-4426-9809-7d59ebed9ec6","slug":"transhub","externalUrl":"https://www.transhub.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","health-providers","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransHub","description":"TransHubは、NSWのすべてのトランスジェンダーや性別多様な人々、彼らの大切な人、協力者、そして健康提供者向けのデジタル情報およびリソースプラットフォームです。本来の自分に向かって成長する過程でこれらにアクセスできなかった可能性があるコミュニティに対して、大いに必要な情報とリソースへのアクセスを提供します。情報は、ホルモン、手術、医師リストといった医療ニーズから社会的および法的な問題に至るまで幅広く対応しています。"},{"id":"e7d26256-017c-4d7e-90d2-30de9386cc03","slug":"twenty10","externalUrl":"https://twenty10.org.au/","tags":["transmasculine","non-binary","transfeminine","social-services","youth-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":{"instagramUrl":"https://www.instagram.com/twenty10glcs/"},"title":"Twenty10","description":"Twenty10はGLCSを含む、レズビアン、ゲイ、バイセクシャル、トランスジェンダーまたはジェンダーダイバース、インターセックス、クイア、セクシャル、または自分のアイデンティティについて疑問を持つ若者に対し、NSW全域でさまざまな人生を変えるサービスを提供します。彼らのサービスには、インテークとリファーラル、住宅とケースマネジメント、カウンセリング、社会支援プログラム、およびLGBTIQA+ の包括性トレーニングが含まれます"},{"id":"eee5057f-7302-4392-b6aa-add70e3e8556","slug":"transgendermap","externalUrl":"https://transgendermap.com","tags":["transfeminine","non-binary","transmasculine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"title":"トランスジェンダーマップ","description":"Transgendermap.comは、自身のジェンダーアイデンティティに疑問を持つ人々や、トランスジェンダーのスペクトル上にいる人々に対して、実用的な情報とガイダンスを提供することを目指したオンラインリソースです。ウェブサイトには、トランスジェンダーの用語の理解、遷移プロセス、法的問題、医療ケア、数多くの個人的なストーリーなど、幅広いトピックが含まれています。その目標は、ジェンダーアイデンティティとトランスジェンダーの経験の多くの側面への「マップ」またはガイドを提供することにより、個々の人々が自身の旅をナビゲートするのを助けることです。最新で正確な情報を得るために、実際のサイトを訪れてください。"},{"id":"f0aa7c03-8837-40f8-82aa-03beb0ac46cc","slug":"transfolk-of-wa","externalUrl":"https://www.transfolkofwa.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"WA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransFolk of WA","description":"西オーストラリア州のトランスジェンダーの人々とその愛する人々を支援するためのピアサポートサービス。オンライングループ、推奨サービスとリソースを提供し、さまざまなイベントを主催しています。"},{"id":"fc8a7875-84dd-4df5-96ec-8aca153c8ea6","slug":"trans-families-home","externalUrl":"https://transfamilies.org","tags":["transmasculine","non-binary","transfeminine","parent-family-resources","support-groups","education-awareness"],"email":null,"phoneNumber":null,"address":null,"socialMedia":null,"title":"トランスの家族","description":"トランスの家族は希望をあたえ、理解を深め、トランスやジェンダー多様性のある子どもたち、そして彼らの生活に関わるすべての人々を支援するための明確な道筋を作ります。私たちはリソースを提供し、イベントを組織し、家族を支援グループにつなぐことでサポートしています。"}]')}}]);